#!/usr/bin/env python3
from collections import Counter

set1 = {3, 14, 15, 9, 26, 5, 35, 9}
set2 = {60, 22, 14, 0, 22, 9}
print(set1)
print(set2)

intersection = (set1 & set2)
print(intersection)

diff = (set1 - set2)
print(diff)

#question 4
nt_comp={}
dna = ''

for nt in dna:
    if nt in nt_comp:
        previous_count = nt_comp[nt]
        new_count = previous_count + 1
        nt_comp[nt] = new_count
    else:
        nt_comp[nt] = 1
print(nt_comp)

dna_counts = Counter(dna)
print(dna_counts)

text_file_obj = open("Python_06.txt","r")
for line in text_file_obj:
    line = line.rstrip()
    print(line)
    line = line.upper()
    print(line)

#question 6 read write on file
with open("Python_06.txt","r") as text_read, open("uppercase_file.txt","w") as text_write:
    for line in text_read:
        line = line.rstrip()
        line = line.upper()
        text_write.write(line)
print('done')


